import React from 'react';
import Link from 'next/link';

const Header = (): JSX.Element => (
    <header
        style={{
            background: `#6c757d`,
            marginBottom: `1.45rem`,
        }}
    >
        <div
            style={{
                margin: `0 auto`,
                maxWidth: 960,
                padding: `1.45rem 1.0875rem`,
            }}
        >
            <Link href="/">
                <h1 style={{ margin: 0, color: `white`, display: `inline-block` }}>Test Store </h1>
            </Link>

            <Link href="/cart">
                <h2 style={{ margin: 0, color: `white`, display: `inline-block`, float: `right` }}>Cart </h2>
            </Link>
        </div>
    </header>
);

export default Header;
